import React from "react";
import { Button } from "semantic-ui-react";

const Counter = () => (
  <Button.Group
    textAlign="center"
    style={{ height: "100vh" }}
  >
    <Button color="red">DECREMENT</Button>
    <Button>RESET</Button>
    <Button color="green">INCREMENT</Button>
  </Button.Group>
);

export default Counter;
